body, 
a,
input {
    font-family: 'Dosis', sans-serif;
    letter-spacing: 1px;
    font-weight: 200;
}

body {
  position: relative;
}
.hide {
    display: none;
}
.block {
    display: block;
}
.clear_fix::after {
    content: "";
    display: block;
    clear: both;
}
.h_font {
    letter-spacing: 10px;
    font-size: 60px;
    color: #333;
}
$maxwidth: 1500px; 

$point: #007a88;

a.more {
    margin-top: 50px;
    color: #007a88;
    position: relative;
    width: 170px;
    display: block;
    &::after {
      content: "";
      display: block;
      width: 40px;
      height: 40px;
      background: #007a88;
      border-radius: 50%;
      position: absolute;
      top: calc(50% - 20px);
      right: -40px;
      transition: 0.5s;
    }
    &:hover::after {
      transform: scale(1.1);
    }
    &:hover span {
      animation-name: more;
      animation-duration: 0.5s;
    }
    span {
      display: block;
      width: 50px;
      height: 1px;
      background: #007a88;
      position: absolute;
      top: calc(50% - 0.5px);
      right: 0;
      transition: 0.5s;
      &::before {
        content: "→";
        position: absolute;
        top: -10px;
        right: -17px;
        color: #fff;
        z-index: 2;
      }
      @keyframes more {
        30% {
          right: -50px;
        }
        50% {
          opacity: 0;
          right: 20px;
        }
        60%{
          opacity: 1;
        }
        100% {
          opacity: 1;
          right: 0;
        }
      }
    }
}

.slide_count {
    position: absolute;
    top: 50%;
    right: 0;
    width: 60px;
    height: 140px;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    transform: translate(50%, -50%);
    @mixin arrow {
        top: -6px;
        font-size: 30px;
        position: absolute;
        font-weight: 400;
    }
    button {
        background: transparent;
        border: none;
        width: 100%;
        height: 20px;
        position: relative;
        cursor: pointer;
        &::before {
        content: "";
        display: inline-block;
        width: 100%;
        height: 2px;
        background: #333;
        }
        &.left::after {
        content: "←";
        left: 0;
        @include arrow;
        }
        &.right::after {
        content: "→";
        right: 0;
        @include arrow;
        }
    }
    span {
        display: block;
        width: 100%;
        font-size: 30px;
        text-align: center;
        letter-spacing: 5px;
        font-weight: 300;
      }
}  



@mixin web_font {
  font-family: "Font Awesome 5 Free";
  font-weight: 900;
  color: #ccc;
  display: block;
}

