// @import "_common.scss";

$gray: #333;
$point: #007a88;
$maxwidth: 1500px; 

@mixin web_font {
  font-family: "Font Awesome 5 Free";
  font-weight: 900;
  color: #ccc;
  display: block;
}

header {
  width: 100%;
  z-index: 2;
  transition: 0.5s;

  .inner {
    margin: 0 auto;
    padding: 60px 50px;
    box-sizing: border-box;
    transition: 0.5s;

  }

  h1 {
    float: left;
    font-size: 25px;
    transform: scale(1.3);
    transform-origin: left;
    position: relative;
    z-index: 2;
    transition: 0.5s;
    a {
      color: #646464;
      letter-spacing: 2px;
      font-weight: bold;
    }
    span {
      font-size: 12px;
      letter-spacing: 1px;
      font-weight: initial;
    }
  }
  .right_menu {
    float: right;
    height: 40px;
  }
  span{
    a {
      height: 100%;
      vertical-align: top;
      color: $gray;
    }
    .search_btn {
      display: inline-block;
      margin-right: 40px;
      cursor: pointer;
    }
    .search_btn span {
      font-size: 35px;
    }
    .site_map {
      width: 30px;
      height: 37px;
      display: inline-block;
      position: relative;
      z-index: 3;
      cursor: pointer;
      @mixin hamburger {
        width: 100%;
        height: 2px;
        display: block;
        background: $gray;
      }
      span {
        @include hamburger;
        position: relative;
        top: 50%;
        transform: translateY(-50%);        
      }
      span::before {
        @include hamburger;
        content: "";
        position: absolute;
        top: 12px;
        transform-origin: 0% 0%;
      }
      span::after {
        @include hamburger;
        content: "";
        position: absolute;
        top: -12px;
        transform-origin: 0% 100%;
      }
      &:hover span::before {
        top: 10px;
      }
      &:hover span::after {
        top: -10px;
      }
      &.current span {
        background: transparent;
      }
      &.current span::before {
        top: 11px;
        animation: hamani3 0.5s forwards;
      }
      &.current span::after {
        top: -11px;
        animation: hamani1 0.5s forwards;
      }

      &.remove span {
        background: $gray;
      }
      &.remove span::before {
        top: 11px;
        animation: xani3 0.5s forwards;
      }
      &.remove span::after {
        top: -11px;
        animation: xani1 0.5s forwards;
      }

      /* x되는 애니*/
      @keyframes hamani1 {
        0% {
          transform: rotate(0deg);
        }
        100% {
          transform: rotate(45deg);
        }
      }
      @keyframes hamani3 {
        0% {
          transform: rotate(0deg);
        }
        100% {
          transform: rotate(-45deg);
        }
      }
      
      /* x에서 햄버거 되는 애니*/
      @keyframes xani1 {
        0% {
          transform: rotate(45deg);
        }
        100% {
          transform: rotate(0deg);
        }
      }
      @keyframes xani3 {
        0% {
          transform: rotate(-45deg);
        }
        100% {
          transform: rotate(0deg);
        }
      }
    }
  }
  &.ch_header {
    background: rgba(255,255,255,.9);
    box-shadow: 0 0 10px rgba(0,0,0,.2);
    position: fixed;
    .inner {
      padding: 20px 40px;
      h1 {
        transform: scale(1);
      }
    }
  }
}

/* --------------- SEARCH BOX ---------- */
.search_box {
  position: fixed;
  top: 0;
  left: 0;
  background: #fff;
  width: 100%;
  z-index: 3;
  transform: translateY(-100%);
  transition: 0.5s;
  box-shadow: 0 0 10px rgba(0,0,0,.3);
  opacity: 0;
  &.current {
    transform: translateY(0);
    opacity: 1;
  }
  .wrap {
    max-width: 60%;
    margin: 0 auto;
    padding: 100px 0;

    form {
      width: 100%;
      position: relative;
      margin-bottom: 50px;

      input[type="text"] {
        display: block;
        width: 100%;
        font-size: 30px;
        padding: 20px 0;
        border: none;
        border-bottom: 1px solid #ccc;
        outline: none;
        transition: 0.7s;
        color: #767676;
        &:focus {
          border-bottom: 1px solid #000;
        }
      }
      input[type="button"] {
        display: none;
      }  
      span {
        position: absolute;
        top:50%;
        right: 0;
        font-size: 30px;
        transform: translateY(-50%);
      }      
    }
    p {
      color: #646464;
      font-weight: 400;
      margin-bottom: 30px;
    }
    ul {
      li {
        margin: 20px 0;
        a {
          font-size: 24px;
          color: #333;
          font-weight: 300;
          transition: 0.5s;
          &:hover {
            color: $point;
          }
        }
      }
    }
  }
  button.close {
    position: absolute;
    top: 30px;
    right: 30px;
    font-size: 0;
    width: 30px;
    height: 30px;
    padding: unset;
    background: transparent;
    border: none;
    cursor: pointer;
    &::before {
      content: "";
      display: block;
      width: 100%;
      height: 2px;
      background: $gray;
      transform-origin: 50% 50%;
      transform: rotate(45deg);
      position: absolute;
    }
    &::after {
      content: "";
      display: block;
      width: 100%;
      height: 2px;
      background: $gray;
      transform-origin: 50% 50%;
      transform: rotate(-45deg);
    }
  }
}
/* -------- NAV ------------ */
nav {
  position: fixed;
  background: #fff;
  height: 100%;
  width: 100%;
  top: 0;
  display: flex;
  z-index: 2;
  opacity: 0;
  transform: translate(100%);
  transition: 1s;
  &.current {
    display: flex;
    transform: translate(0);
    opacity: 1;
  }
  .gnb {
    width: 50%;
    position: relative;
    div.wrap {
      padding: 150px 20%;
      div {
        margin-bottom: 30px;
        h2 {
          font-size: 34px;
          letter-spacing: 9px;
          color:  $point;
          font-weight: 300;
        }
      }
    }
    ul {
      margin-top: 20px;
      li {
        margin-bottom: 15px;
        a {
          color: #646464;
          font-size: 18px;
          display: inline-block;
          font-weight: 300;
          padding: 5px 0;
          border-bottom: 1px solid transparent;
          transition: 0.5s;
          &:hover {
            border-bottom: 1px solid  $point;
          }
        }
        
      }
    }
  }
  span.sns {
    position: absolute;
    bottom: 10%;
    a {
      margin-right: 30px;
    }
    i {
      font-size: 25px;
    }
  }
  .nav_slide {
    width: 50%;
    position: relative;
    ul.slide {
      height: 100%;
      // width: calc(100% * 3);
      display: flex;
      li {
        width: 100%;
        height: 100%;
        display: flex;
        align-items: center;
        padding: 80px;
        box-sizing: border-box;
        &:nth-child(1){
          background: {
            color: #bae4e9;
            image: url("../img/facial-eraser-cleansing-oil-foam-hover.jpg");
            repeat: no-repeat;
            position: center;
          }
        }
        &:nth-child(2){
          background: {
            color: #e2cbe3;
            image: url("../img/true-ampoule-mask-hover.jpg");
            repeat: no-repeat;
            position: center;
          }
        }
        &:nth-child(3){
          background: {
            color: #bcb7d4;
            image: url("../img/deep-sea-waterfall-cream-hover.jpg");
            repeat: no-repeat;
            position: center;
          }
        }
        .wrap {
          font-weight: 300;
          color:#474747;
        }
        h3 {
          font-size: 32px;
          letter-spacing: 8px;
          margin-bottom: 20px;
        }
        p {
          line-height: 1.5;
          margin-bottom: 50px;
        }
        a {
          color: #646464;
          line-height: 1.5;
          border-bottom: 1px solid #646464;
          transition: 0.5s;
          &:hover {
            color: #000;
          }
        }
      }
    }
    .swiper-pagination {
      bottom: 10%;
      span {
        width: 20px;
        height: 20px;
        margin: 7px;
        border-radius: 50%;
        box-sizing: border-box;
        cursor: pointer;
        position: relative;
        background-color: transparent;
        &::after {
          content: "";
          display: block;
          width: 7px;
          height: 7px;
          background: #fff;
          border-radius: 50%;
          position: absolute;
          top: 50%;
          left: 50%;
          transform: translate(-50%, -50%);
          box-shadow: 1px 2px 1px rgba(0,0,0,.2);
        }
        &.swiper-pagination-bullet-active {
          border: 1px solid #fff;
          box-shadow: 1px 2px 1px rgba(0,0,0,.2);
        }
      }
    }
  }
}

